from scipy.interpolate import interp1d


# 定义VAE模型
class VAE(nn.Module):
    def __init__(self, input_dim, latent_dim):
        super(VAE, self).__init__()
        self.encoder = nn.Sequential(
            nn.Linear(input_dim, 16),
            nn.ReLU(),
            nn.Linear(16, 8),
            nn.ReLU(),
            nn.Linear(8, latent_dim * 2)  # 由于潜在变量是高斯分布，因此输出维度是两倍的潜在维度
        )
        self.decoder = nn.Sequential(
            nn.Linear(latent_dim, 8),
            nn.ReLU(),
            nn.Linear(8, 16),
            nn.ReLU(),
            nn.Linear(16, input_dim)
        )

    def reparameterize(self, mu, logvar):
        std = torch.exp(0.5 * logvar)
        eps = torch.randn_like(std)
        return mu + eps * std

    def forward(self, x):
        z_mu_logvar = self.encoder(x)
        mu, logvar = torch.chunk(z_mu_logvar, 2, dim=1)
        z = self.reparameterize(mu, logvar)
        return self.decoder(z), mu, logvar


# 定义训练函数
def train_vae(model, data, epochs=100, batch_size=32, learning_rate=0.001):
    optimizer = optim.Adam(model.parameters(), lr=learning_rate)
    criterion = nn.MSELoss()

    losses = []
    for epoch in range(epochs):
        total_loss = 0
        for i in range(0, len(data), batch_size):
            batch = torch.tensor(data[i:i + batch_size], dtype=torch.float32)
            recon_batch, mu, logvar = model(batch)
            loss = criterion(recon_batch, batch) + 0.5 * torch.sum(logvar.exp() - logvar - 1 + mu.pow(2))
            optimizer.zero_grad()
            loss.backward()
            optimizer.step()
            total_loss += loss.item()
        losses.append(total_loss / len(data))
        print(f"Epoch {epoch + 1}/{epochs}, Loss: {total_loss / len(data)}")

    # 保存模型
    torch.save(model.state_dict(), './model/vae_model.pt')

    return losses


# 定义测试函数
# 定义生成潜在特征函数

def generate_latent_feature(data, new_data=None, save_plot=True):
    # 加载模型
    loaded_model = VAE(input_dim=8, latent_dim=4)
    loaded_model.load_state_dict(torch.load('./model/vae_model.pt'))

    # 检查并创建保存图像的文件夹
    if save_plot:
        if not os.path.exists('plots'):
            os.makedirs('plots')

    with torch.no_grad():
        encoded = []
        for i in range(len(data)):
            input_data = torch.tensor(data[i], dtype=torch.float32).unsqueeze(0)
            _, mu, _ = loaded_model(input_data)
            encoded.append(mu.numpy()[0])
        encoded = np.array(encoded)

        # 创建一个4x4的子图
        fig, axs = plt.subplots(2, 2, figsize=(10, 10))

        # 遍历四个维度并绘制曲线
        for i in range(4):
            row = i // 2
            col = i % 2
            y, bin_edges = np.histogram(encoded[:, i], bins=30, density=True)
            x = (bin_edges[:-1] + bin_edges[1:]) / 2  # 使用 bin 的中点作为 x 数据
            f = interp1d(x, y, kind='cubic', bounds_error=False, fill_value='extrapolate')  # 设置 bounds_error=False
            x_new = np.linspace(encoded[:, i].min(), encoded[:, i].max(), 300)

            # 确保生成的新 x 值在原始数据范围内
            x_min, x_max = encoded[:, i].min(), encoded[:, i].max()
            x_new = x_new[(x_new >= x_min) & (x_new <= x_max)]

            y_smooth = f(x_new)
            axs[row, col].plot(x_new, y_smooth, color='skyblue', lw=2)
            axs[row, col].set_xlabel('Latent Dimension {}'.format(i + 1))
            axs[row, col].set_ylabel('Density')
            axs[row, col].set_title('Smoothed Plot of Latent Dimension {}'.format(i + 1))

            # 如果有新数据，则在图上绘制红色点
            if new_data:
                for new_point in new_data:
                    input_data = torch.tensor(new_point, dtype=torch.float32).unsqueeze(0)
                    _, mu, _ = loaded_model(input_data)
                    new_encoded = mu.numpy()[0]
                    axs[row, col].scatter(new_encoded[i], 0, color='red', marker='o')

        # 调整布局
        plt.tight_layout()

        # 如果要保存图像，则保存到指定路径
        if save_plot:
            plot_path = 'plots/latent_space_plot.png'
            plt.savefig(plot_path)
            plt.close()
            return plot_path

def read_excel_first_column(file_path):
    # 读取 Excel 文件的第一列数据
    df = pd.read_excel(file_path, header=None)
    first_column_data = df.iloc[:, 0].tolist()

    # 将每个字符串转换为 float，并构建新的列表
    data = []
    for value in first_column_data:
        # 尝试解析字符串表示的列表，并将其中的元素转换为 float
        try:
            value_list = ast.literal_eval(value)
            float_list = [float(item) for item in value_list]
            data.append(float_list)
        except (SyntaxError, ValueError):
            pass  # 如果解析失败，则跳过该值

    return data


def plot_latent_features_on_image(model, states):
    # 加载保存的图像
    plot_path = 'plots/latent_space_plot.png'
    if not os.path.exists(plot_path):
        print("Error: Plot image does not exist. Please generate the latent space plot first.")
        return

    img = plt.imread(plot_path)
    plt.imshow(img)

    # 加载模型
    loaded_model = model
    loaded_model.load_state_dict(torch.load('./model/vae_model.pt'))

    with torch.no_grad():
        # 获取状态的潜在特征
        latent_features = []
        for state in states:
            input_data = torch.tensor(state, dtype=torch.float32).unsqueeze(0)
            _, mu, _ = loaded_model(input_data)
            latent_features.append(mu.numpy()[0])
        latent_features = np.array(latent_features)

        # 绘制状态的潜在特征点
        for feature in latent_features:
            plt.scatter(feature[0], feature[1], color='red', marker='o', s=100)  # 假设只绘制前两个维度的特征点

        # 显示图例
        plt.legend(['Original Latent Features', 'New Latent Features'], loc='upper right')
        plt.show()


def get_initial_states():
    import json

    # 读取JSON文件
    with open('states_record2.json', 'r') as f:
        data = json.load(f)

    # 根据total_reward对数据进行排序
    sorted_data = sorted(data, key=lambda x: x['total_reward'])

    # 获取最大和最小的20个total_reward
    top_20_max_rewards = sorted_data[-20:]
    top_20_min_rewards = sorted_data[:20]

    # 提取最大和最小total_reward对应的初始states
    max_initial_states = [episode['states'][0] for episode in top_20_max_rewards]
    min_initial_states = [episode['states'][0] for episode in top_20_min_rewards]

    print("最大的20个初始状态：", max_initial_states)
    print("最小的20个初始状态：", min_initial_states)




